import React, {Component} from 'react';

class Play extends Component {

  constructor(props) {
    super(props);
    this.quizz = quizzes.filter(q=> q._uid == this.props.match.params.id)
  }
  render() {
      return (
    <h1>Playing</h1>
      );
    }
}

export {Play};
